import React, { Component } from 'react';
class ItemCart extends Component {
    render() {
        var {stt}=this.props
        var {name}=this.props
        var {img}=this.props
        var {price}=this.props
        return (
            <tr>
                <th>{stt}</th>
                <th>
                    <div>{name}</div>
                    <img src={img}/>
                </th>
                <th>SỐ LƯỢNG</th>
                <th>{price}(VNĐ)</th>
                <th>TỔNG</th>
                <th>
                    <div>X</div></th>
            </tr>
        )
    }
}
export default ItemCart;
